import React from 'react';
import Plotly from "plotly.js"
import createPlotlyComponent from 'react-plotly.js/factory';
const Plot = createPlotlyComponent(Plotly);

export  class GraphicGroup extends React.Component
{
  // console.log(this.props.name);
  render(){
    return (
    <SingleGraphic name={this.props.name}/>
    );
  }
}


function SingleGraphic (name, x, y){
  console.log(name);
  const plotlydata =[
    {
      x: x,
      y: [-30, -10, -30, 30, 30, 40, 37, 7, 40, 25, 25, -4, -37, 36, 36, 40, 24, -1, -21, -1, -1, -21, 11, 40, -25, -25, 18, -15, -10, -40, 38, 10, 37, -30, -4, -4, -10, -40, -35, 10],
      type: 'bar'
    }
  ];
  return  <Plot
        data={plotlydata}
        layout={ {width: 500, height: 500, title: name} }
      />



}
